(lib.Sparks = function(mode,startPosition,loop) {
	this.initialize(mode,startPosition,loop,{});
	// timeline functions:
	this.frame_0 = function() {
		var mc = this;
		var glow = this.glow;
		var sparks = [];
		var max = 10;
		glow.alpha = .1;
		while(sparks.length < max) {
			var spark = new Spark(0,0);
			sparks.push(spark);
			mc.addChild(spark.sprite);
		}
		this.addEventListener('tick', update);
		function update() {	
			for (var spark of sparks) {
				spark.update();
			}
			glow.alpha -= .1;
			if (glow.alpha < 0) glow.alpha = 0;
		}
		function Spark(x,y) {
			var vx=0, vy=0, va=0;
			this.sprite = new lib.Spark();
			this.update = function() {
				this.sprite.x += vx;
				this.sprite.y += vy;
				this.sprite.rotation = 90 + Math.atan2(vy,vx)*180/Math.PI;
				this.sprite.alpha -= va;
				vy += 0.8*this.sprite.scaleX;
				if (this.sprite.alpha <= 0) this.reset();
			}
			this.reset = function() {
				glow.alpha += .15;
				this.sprite.x = x;
				this.sprite.y = y;
				this.sprite.alpha = 1;
				this.sprite.scaleX = this.sprite.scaleY = 0.5 + 0.5*Math.random();
				vx = -2.5 + 5*Math.random();
				vy = -5 + 10*Math.random();		
				va = 0.02 + 0.1*Math.random();		
			}
			this.reset();
		}
	}
	// actions tween:
	this.timeline.addTween(cjs.Tween.get(this).call(this.frame_0).wait(1));
	// Layer_2
	this.glow = new lib.glow2();
	this.glow.name = "glow";
	this.glow.parent = this;
	this.timeline.addTween(cjs.Tween.get(this.glow).wait(1));
}).prototype = getMCSymbolPrototype(lib.Sparks, new cjs.Rectangle(-7.4,-7.4,14.9,14.9), null);

(lib.electropanel = function(mode,startPosition,loop) {
	this.initialize(mode,startPosition,loop,{});
	this.___GetDepth___ = function(obj) {
		var depth = obj.depth;
		var cameraObj = this.___camera___instance;
		if(cameraObj && cameraObj.depth && obj.isAttachedToCamera)
		{
			depth += depth + cameraObj.depth;
		}
		return depth;
		}
	this.___needSorting___ = function() {
		for (var i = 0; i < this.getNumChildren() - 1; i++)
		{
			var prevDepth = this.___GetDepth___(this.getChildAt(i));
			var nextDepth = this.___GetDepth___(this.getChildAt(i + 1));
			if (prevDepth < nextDepth)
				return true;
		}
		return false;
	}
	this.___sortFunction___ = function(obj1, obj2) {
		return (this.exportRoot.___GetDepth___(obj2) - this.exportRoot.___GetDepth___(obj1));
	}
	this.on('tick', function (event){
		var curTimeline = event.currentTarget;
		if (curTimeline.___needSorting___()){
			this.sortChildren(curTimeline.___sortFunction___);
		}
	});
	// timeline functions:
	this.frame_0 = function() {
		this.ps_land = this.packshot_landscape.ps_land;
		this.ps_port = this.packshot_portrait.ps_port;
		this.solve = this.can_solve.solve;
		if(this.flash.parent == undefined || this.flash.parent == this)
		this.flash = this.flash.flash;
		if(this.panel.parent == undefined || this.panel.parent == this)
		this.panel = this.panel.panel;
	}

		var sparks2 = panel.sparks2;
		var sparks3 = panel.sparks3;
		var place1 = new cjs.Point(part1.x, part1.y);
		var place2 = new cjs.Point(part2.x, part2.y);
		var wire1 = panel.wire1;
		var wire2 = panel.wire2;
		wire2.y -= 50;
		var endPnt1 = new cjs.Point();
		var endPnt2 = new cjs.Point();

		var ps_port = this.ps_port;
		var ps_land = this.ps_land;
		var solve = this.solve;

		var flash_sound = new Howl({src: [flash_src]});
		var portrait = {
			panel:{x:-90,y:0},
			part1:{x:440,y:845},
			part2:{x:260,y:830},
			flash:{x:-235,y:0},
			solve:{x:-210,y:5},
			bar:{x:400,y:910,rotation:90}
		}
		var landscape = {
			panel:{x:90,y:-10},
			part1:{x:770,y:395},
			part2:{x:795,y:175},
			flash:{x:0,y:-163},
			solve:{x:-30,y:0},
			bar:{x:833,y:354,rotation:0}
		}
		function makeDraggable(mc, place) {
			var pt = new cjs.Point();
			//mc.home = new cjs.Point(mc.x, mc.y);	
			var dx, dy; 
			mc.toX = mc.home.x;
			mc.toY = mc.home.y;
			mc.placed = false;
			mc.on("mousedown", function(evt) {
				panel.globalToLocal(evt.stageX, evt.stageY, pt);
				dx = mc.x - pt.x;
				dy = mc.y - pt.y;
			});
			mc.on("pressup", function(evt) {
				if (isPlaced(75, place1) || isPlaced(75, place2)) {
					mc.toX = place.x;
					mc.toY = place.y;
					if (mc == part1) sparks1.visible = sparks2.visible = false;
					if (mc == part2) sparks3.visible = false;
				} else {
					mc.toX = mc.home.x;
					mc.toY = mc.home.y;
					mc.glow.visible = true;
				}
			});	
			mc.on("pressmove", function(evt) {
				panel.globalToLocal(evt.stageX, evt.stageY, pt);
				mc.toX = pt.x + dx;
				mc.toY = pt.y + dy;
				mc.glow.visible = false;
			});
			mc.addEventListener('tick', update);

				if (isPlaced()) {
					mc.toX = place.x;
					mc.toY = place.y;

					if (mc == part2) sparks3.visible = false;
				}		
				if (isPlaced(0.1)) {
					if (mc.init) mc.init();
					mc.placed = true;
					mc.removeAllEventListeners();
					count++;
					if (count == 2) showWires();
				}	
				mc.x += (mc.toX - mc.x)/2;
				mc.y += (mc.toY - mc.y)/2;
			}
			function isPlaced(dist=75, p) {
				if (!p) p = place;

			}
		}
		function showWires() {

		function makeWire(mc, degree, spx, spy, dr, minDegree, maxDegree, len) {
			var vr = 0;
			var dx, dy; 
			var isMove = false;
			var pt = new cjs.Point();
			var spark = new lib.Sparks();
			var minScale = 0.85;
			var maxScale = 1.2;
			spark.x = spx;
			spark.y = spy;
			mc.spark = spark;
			mc.addChild(spark);	
			mc.addEventListener('tick', update);
			function update() {
				if (isMove) return;
				var dr = degree - mc.rotation;		
				vr += dr/20;
				mc.rotation += vr;
				mc.scaleX += (1-mc.scaleX)/5;
				vr *= 0.85;
				spark.rotation = -mc.rotation;		
			}	
			mc.btn.on("pressmove", function(evt) {
				isMove = true;
				panel.globalToLocal(evt.stageX, evt.stageY, pt);		
				mc.scaleX = distance(pt, mc)/len;
				mc.rotation = 180/Math.PI * Math.atan2(pt.y-mc.y, pt.x-mc.x) + dr;	
				if (mc.rotation > maxDegree) mc.rotation = maxDegree;
				if (mc.rotation < minDegree) mc.rotation = minDegree;
				if (mc.scaleX > maxScale) mc.scaleX = maxScale;
				if (mc.scaleX < minScale) mc.scaleX = minScale;
				if (isWireConnect()) showPackshot();
			});
			mc.on("pressup", function(evt) {
				isMove = false;
			})
		}
		function distance(pt1, pt2) {
			var dx = pt2.x - pt1.x;
			var dy = pt2.y - pt1.y;
			return Math.sqrt(dx*dx+dy*dy);
		}
		function isWireConnect() {
			wire1.localToLocal(480, 480, panel, endPnt1);
			wire2.localToLocal(570, 40, panel, endPnt2);
			/*console.clear();
			console.log(endPnt1);
			console.log(endPnt2);
			console.log(distance(endPnt1,endPnt2));*/
			return distance(endPnt1,endPnt2) < 40; 
		}
		function showPackshot() {
			wire1.removeAllEventListeners();
			wire2.removeAllEventListeners();
			wire1.btn.removeAllEventListeners();
			wire2.btn.removeAllEventListeners();
			flash.visible = true;
			ps_land.play();
			ps_port.play();
			flash_sound.play();			
		}
		makeDraggable(part1, place1);
		makeDraggable(part2, place2);
		window.addEventListener('resize', onResize);		
		onResize();		
		function onResize() {			
			var iw = window.innerWidth, ih=window.innerHeight;	
			var isPortrait = iw < ih;	
			if (isPortrait) {
				//console.log('portrait');
				ps_land.visible = false;
				ps_port.visible = true;
				panel.set(portrait.panel);
				flash.set(portrait.flash);		
				solve.set(portrait.solve);

				if (!part1.placed) part1.set(portrait.part1);
				if (!part2.placed) part2.set(portrait.part2);
				part1.home.x = portrait.part1.x;
				part1.home.y = portrait.part1.y;
				part2.home.x = portrait.part2.x;
				part2.home.y = portrait.part2.y;
			} else {
				//console.log('landscape');
				ps_land.visible = true;
				ps_port.visible = false;
				panel.set(landscape.panel);
				flash.set(landscape.flash);	
				solve.set(landscape.solve);		
				bar.set(landscape.bar);		
				if (!part1.placed) part1.set(landscape.part1);
				if (!part2.placed) part2.set(landscape.part2);

		stage.addEventListener("tick", handleTick)
		function getProjectionMatrix(container, totalDepth) {
			var focalLength = 528.25;
			var projectionCenter = { x : lib.properties.width/2, y : lib.properties.height/2 };
			var scale = (totalDepth + focalLength)/focalLength;
			var scaleMat = new createjs.Matrix2D;
			scaleMat.a = 1/scale;
			scaleMat.d = 1/scale;
			var projMat = new createjs.Matrix2D;
			projMat.tx = -projectionCenter.x;
			projMat.ty = -projectionCenter.y;
			projMat = projMat.prependMatrix(scaleMat);
			projMat.tx += projectionCenter.x;
			projMat.ty += projectionCenter.y;
			return projMat;
		}
		function handleTick(event) {
			var cameraInstance = exportRoot.___camera___instance;
			if(cameraInstance !== undefined && cameraInstance.pinToObject !== undefined)
			{
				cameraInstance.x = cameraInstance.pinToObject.x + cameraInstance.pinToObject.pinOffsetX;
				cameraInstance.y = cameraInstance.pinToObject.y + cameraInstance.pinToObject.pinOffsetY;
				if(cameraInstance.pinToObject.parent !== undefined && cameraInstance.pinToObject.parent.depth !== undefined)
				cameraInstance.depth = cameraInstance.pinToObject.parent.depth + cameraInstance.pinToObject.pinOffsetZ;
			}
			applyLayerZDepth(exportRoot);
		}
		function applyLayerZDepth(parent)
		{
			var cameraInstance = parent.___camera___instance;
			var focalLength = 528.25;
			var projectionCenter = { 'x' : 0, 'y' : 0};
			if(parent === exportRoot)
			{
				var stageCenter = { 'x' : lib.properties.width/2, 'y' : lib.properties.height/2 };
				projectionCenter.x = stageCenter.x;
				projectionCenter.y = stageCenter.y;
			}
			for(child in parent.children)
			{
				var layerObj = parent.children[child];
				if(layerObj == cameraInstance)
					continue;
				applyLayerZDepth(layerObj, cameraInstance);
				if(layerObj.layerDepth === undefined)
					continue;
				if(layerObj.currentFrame != layerObj.parent.currentFrame)
				{
					layerObj.gotoAndPlay(layerObj.parent.currentFrame);
				}
				var matToApply = new createjs.Matrix2D;
				var cameraMat = new createjs.Matrix2D;
				var totalDepth = layerObj.layerDepth ? layerObj.layerDepth : 0;
				var cameraDepth = 0;
				if(cameraInstance && !layerObj.isAttachedToCamera)
				{
					var mat = cameraInstance.getMatrix();
					mat.tx -= projectionCenter.x;
					mat.ty -= projectionCenter.y;
					cameraMat = mat.invert();
					cameraMat.prependTransform(projectionCenter.x, projectionCenter.y, 1, 1, 0, 0, 0, 0, 0);
					cameraMat.appendTransform(-projectionCenter.x, -projectionCenter.y, 1, 1, 0, 0, 0, 0, 0);
					if(cameraInstance.depth)
						cameraDepth = cameraInstance.depth;
				}
				if(layerObj.depth)
				{
					totalDepth = layerObj.depth;
				}
				//Offset by camera depth
				totalDepth -= cameraDepth;
				if(totalDepth < -focalLength)
				{
					matToApply.a = 0;
					matToApply.d = 0;
				}
				else
				{
					if(layerObj.layerDepth)
					{
						var sizeLockedMat = getProjectionMatrix(parent, layerObj.layerDepth);
						if(sizeLockedMat)
						{
							sizeLockedMat.invert();
							matToApply.prependMatrix(sizeLockedMat);
						}
					}
					matToApply.prependMatrix(cameraMat);
					var projMat = getProjectionMatrix(parent, totalDepth);
					if(projMat)
					{
						matToApply.prependMatrix(projMat);
					}
				}
				layerObj.transformMatrix = matToApply;
			}
		}
	}	    
	//Code to support hidpi screens and responsive scaling.
	function makeResponsive(isResp, respDim, isScale, scaleType) {		
		var lastW, lastH, lastS=1;		
		window.addEventListener('resize', resizeCanvas);		
		resizeCanvas();		
		function resizeCanvas() {			
			var w = lib.properties.width, h = lib.properties.height;			
			var iw = window.innerWidth, ih=window.innerHeight;	
			if (iw < ih) {
				w = lib.properties.height;
				h = lib.properties.width;
			}			
			var pRatio = window.devicePixelRatio || 1, xRatio=iw/w, yRatio=ih/h, sRatio=1;			
			if(isResp) {                
				if((respDim=='width'&&lastW==iw) || (respDim=='height'&&lastH==ih)) {                    
					sRatio = lastS;                
				}				
				else if(!isScale) {					
					if(iw<w || ih<h)						
						sRatio = Math.min(xRatio, yRatio);				
				}				
				else if(scaleType==1) {					
					sRatio = Math.min(xRatio, yRatio);				
				}				
				else if(scaleType==2) {					
					sRatio = Math.max(xRatio, yRatio);				
				}			
			}			
			canvas.width = w*pRatio*sRatio;			
			canvas.height = h*pRatio*sRatio;
			canvas.style.width = dom_overlay_container.style.width = anim_container.style.width =  w*sRatio+'px';				
			canvas.style.height = anim_container.style.height = dom_overlay_container.style.height = h*sRatio+'px';
			stage.scaleX = pRatio*sRatio;			
			stage.scaleY = pRatio*sRatio;			
			lastW = iw; lastH = ih; lastS = sRatio;
			stage.tickOnUpdate = false;            
			stage.update();            
			stage.tickOnUpdate = true;		
		}
	}
	makeResponsive(true,'both',true,1);	
	AdobeAn.compositionLoaded(lib.properties.id);
	fnStartAnimation();
	
	var music = new Howl({
        src: [music_src],
        autoplay: true,
        loop: true
    });
}
